e7\u00e3o Inicial e Continuada (FIC) de Microempreendedor Individual (MEI) de 180 horas, na modalidade presencial, podendo ser flexibilizado at\u00e9 20% da Carga Hor\u00e1ria em atividades a dist\u00e2ncia, para o p\u00fablico alvo prioritariamente, estudantes matriculados nos Centros\u00a0Educacionais/Escolas Estaduais vinculadas \u00e0 Fucam e trabalhadores/pessoas em condi\u00e7\u00f5es de vulnerabilidade social atendidos pela FUCAM, podendo, havendo vagas remanescentes, ser\u00e1 ofertado ao p\u00fablico em geral, com 16 anos ou mais, Ensino Fundamental I Completo, nos Centros Educacional da FUCAM de Minas Gerais, no per\u00edodo de janeiro de 2023 a janeiro de 2024. A execu\u00e7\u00e3o do projeto ser\u00e1 em duas etapas ofertando 210 em cada uma delas.\u003c/p\u003e\u003cp\u003ePara al\u00e9m do desenvolvimento t\u00e9cnico, por meio de disciplina formal, constante no curr\u00edculo, ser\u00e3o desenvolvidas as compet\u00eancias para desenvolvimento integral do estudante, com vistas a prepar\u00e1-lo para a gest\u00e3o consciente e cr\u00edtica de seu neg\u00f3cio.\u003c/p\u003e\u003cp\u003eAl\u00e9m da teoria, ser\u00e1 trabalhada a pr\u00e1tica, por meio de uma etapa gamificada denominada \u0026#34;Desafio do Empreendedor\u0026#34;, em que os estudantes formatar\u00e3o um modelo de neg\u00f3cios que passar\u00e1 por uma banca composta por profissionais de mercado contratados para acompanhar e avaliar as propostas.\u00a0\u003c/p\u003e\u003cp\u003eAos melhores projetos, ser\u00e1 destinado um pr\u00eamio para os tr\u00eas primeiros finalistas que ser\u00e3o premiados com aporte financeiro para implementa\u00e7\u00e3o da proposta, sendo:\u00a0\u003c/p\u003e\u003cp\u003e3\u00ba Lugar: R$2.000,00\u003c/p\u003e\u003cp\u003e\u00a02\u00ba Lugar: R$3.000,00\u003c/p\u003e\u003cp\u003e1\u00ba Lugar: R$5.000,00\u003c/p\u003e"], "code": "foreign-key-error", "description": "Values in the foreign key fields should exist in the reference table", "message": "Row at positio <script>

document.addEventListener("DOMContentLoaded", function () {
  const content = document.querySelector("#livemark-main");
  const headings = content.querySelectorAll("h1, h2, h3, h4, h5, h6, h7");
  const headingMap = {};

  // Add identifiers
  Array.prototype.forEach.call(headings, function (heading) {
    const id = heading.id
      ? heading.id
      : heading.textContent
          .trim()
          .toLowerCase()
          .split(" ")
          .join("-")
          .replace(/[!@#$%^&*():]/gi, "")
          .replace(/\//gi, "-");
    headingMap[id] = !isNaN(headingMap[id]) ? ++headingMap[id] : 0;
    if (headingMap[id]) {
      heading.id = id + "-" + headingMap[id];
    } else {
      heading.id = id;
    }
  });

  // Add links
  Array.prototype.forEach.call(headings, function (heading) {
    const link = document.createElement("a");
    link.href = "#" + heading.id;
    link.innerText = "#";
    link.classList.add("heading");
    heading.appendChild(link);
  });
});

</script>

<script>

document.addEventListener("DOMContentLoaded", function () {
  // Start tocbot
  tocbot.init({
    // Where to render the table of contents.
    tocSelector: ".toc",
    // Where to grab the headings to build the table of contents.
    contentSelector: "#livemark-main",
    // Which headings to grab inside of the contentSelector element.
    headingSelector: "h2, h3",
    // For headings inside relative or absolute positioned containers within content.
    hasInnerContainers: true,
    // Called each time a heading is parsed. Expects a string in return.
    headingLabelCallback: (label) => label.replace(/(^#|#$)/g, "").trim(),
    // Disable generating ordered lists (ol)
    orderedList: false,
    // Fix active link class
    onClick: syncList,
    scrollEndCallback: syncList,
  });

  // Style list
  $("#livemark-topics .toc > ul").addClass("primary");
  $("#livemark-topics .toc > ul > li").addClass("primary");
  $("#livemark-topics .toc > ul > li > a").addClass("primary");
  $("#livemark-topics .toc ul.is-collapsible").addClass("secondary");
  $("#livemark-topics .toc ul.is-collapsible li").addClass("secondary");
  $("#livemark-topics .toc ul.is-collapsible li > a").addClass("secondary");
  for (const element of $("#livemark-topics .primary")) {
    if ($(element).find(".secondary").length) {
      $(element).addClass("group");
    }
  }

  // Sync list
  function syncList() {
    for (const element of $("#livemark-topics li.primary")) {
      if ($(element).find(".is-active-li").length) {
        $(element).addClass("is-active-li");
      }
    }
  }
  syncList();
});

</script>

});

<script>

document.addEventListener("DOMContentLoaded", function () {
  const container = $(".livemark-infinity");
  if (container.length) {
    const elements = container
      .children()
      .map((index, element) => element.outerHTML)
      .get();
    container.html(elements.splice(0, 100));
    container.show();
    window.addEventListener("scroll", () => {
      const element = container.get(0);
      const position = window.scrollY + window.innerHeight + 100;
      const threshold = element.offsetTop + element.scrollHeight;
      if (position > threshold) {
        container.append(elements.splice(0, 100));
      }
    });
  }
});

</script>
<script>

document.addEventListener("DOMContentLoaded", function () {
  const left = document.getElementById("livemark-left");
  const mobile = document.getElementById("livemark-mobile");
  mobile.addEventListener("click", () => {
    left.classList.toggle("active");
    mobile.classList.toggle("active");
  });
  // NOTE: We can replace the selector by 'a:not[href=""]' after #57
  left.querySelectorAll("li:not(.group) a").forEach((link) => {
    link.addEventListener("click", () => {
      if (left.classList.contains("active")) {
        left.classList.remove("active");
        mobile.classList.remove("active");
      }
    });
  });
});

<script>

document.addEventListener("DOMContentLoaded", function () {
  // Add buttons
  $("h2").append('<a href="" class="livemark-source-button">Source</a>');

  // Enable buttons
  $(".livemark-source-button").click(async (ev) => {
    ev.preventDefault();

    // Close open
    if ($(".livemark-source-section").length) {
      $(".livemark-source-section").remove();
      return;
    }

    // Load content
    let source = location.href.replace(".html", ".md");
    if (!source.endsWith(".md")) source = `${source}index.md`;
    const heading = $(ev.target).parent().contents().get(0).nodeValue;
    response = await fetch(source);
    content = await response.text();

    // Extract section
    let isCapture;
    const lines = [];
    for (const line of content.split(/\r?\n/)) {
      if (line.startsWith("##")) {
        isCapture = line.startsWith(`## ${heading}`) ? true : false;
        continue;
      }
      if (isCapture) {
        lines.push(line);
      }
    }
    const section = _.escape(lines.join("\n").trim());

    // Show section
    $(ev.target)
      .parent()
      .after(
        `<pre class="livemark-source-section" style="white-space: pre-wrap;">${section}</pre>`
      );
  });
});

</script>
